var list = [data.story1, data2.story2];
const getItems = () => {
  var listStr = "";
  list.forEach((Element) => {
    listStr += " <div>      <div>" + String(Element.title) + "</div>    </div>";

  });
  console.log(listStr);
  return listStr;
};
var k = getItems();

const Index = () => (
  <div class="parent">
    <div class="card card-2">
      <div class="custom-header">Your Stories</div>
      <hr></hr>

      <a class="button" href="#">
        <svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 24 24"
          fill="white"
          width="36px"
          height="36px"
        >
          <path d="M0 0h24v24H0z" fill="none" />
          <path d="M19 13h-6v6h-2v-6H5v-2h6V5h2v6h6v2z" />
        </svg>
        Add story
      </a>
      {list.length >= 1 &&
          this.state.list.map((item, index) => {
            return (
              <DynamicForm
                key={item}
                {...this.props}
                formSerial={item}
              />
            );
          })}
    </div>
  </div>
);

const CardIndex = () => <div class="card card-1"></div>;

